import styles from '../Styles/styles.css' 

function Register() {
    return (
      <div>
        <h1>This is Register</h1>
        <form>
  <label>
    Name:
    <input type="text" name="name" />
  </label>
  <input type="submit" value="Submit" />
</form>
      </div>
    );
  }
  
  export default Register;
